import { Injectable } from '@angular/core';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Injectable({
  providedIn: 'root'
})
export class PdfService {
  constructor() { }

  generateSchedulePdf(data) {
    console.log(data);
    // const documentDefinition = {
    //    content: 'This is an sample PDF printed with pdfMake'
    // };
    //pdfMake.createPdf(documentDefinition).download();
    // pdfMake.createPdf(documentDefinition).open({}, window);

    const dd = {
      content: [
        { text: 'График за почистване на снега', style: 'header' },
        {
          style: 'tableSchedule',
          table: {
            headerRows: 1,
            // dontBreakRows: true,
            // keepWithHeaderRows: 1,
            widths: [200, '*', '*'],
            body: [
              [{ text: 'Седмица', style: 'tableHeader' },
              { text: 'Двор', style: 'tableHeader' },
              { text: 'Рампа', style: 'tableHeader' }],
              ...data.map(week => {
                return [week.fromTo, week.flatNo.name, week.parkingLot.name + ' (' + week.parkingLot.ownerName + ')']
              }),
            ]
          },

        },
        {
          image: 'data:image/jpeg;base64,',
          width: 400
        },
      ],
      styles: {
        header: {
          fontSize: 18,
          bold: true,
          margin: [0, 0, 0, 10]
        },
        subheader: {
          fontSize: 16,
          bold: true,
          margin: [0, 10, 0, 5]
        },
        tableSchedule: {
          margin: [0, 5, 0, 15],
          fontSize: 16
        },
        tableHeader: {
          bold: true,
          fontSize: 18,
          color: 'black'
        }
      },
    };

    pdfMake.createPdf(dd).download();
  }
}
